import Vue from 'vue'
import VueRouter from 'vue-router'
import PetInitial from '../views/Initial'
Vue.use(VueRouter)
const routes = [
    {
        path: '/',
        name: 'PetInitial',
        component: PetInitial
    }
]

const router = new VueRouter({
    routes
})

export default router
